import React from 'react';
import {
    Card,
    CardContent,
    Typography
} from '@material-ui/core';
/*
{
    data.map(informacion =>(
        <div id={informacion.id}>
            <Card>
                <CardContent>
                    <Typography variant="h6" gutterBottom>Nombre: {informacion.nombre}</Typography>
                    <Typography variant="h6" gutterBottom>Apelllido: {informacion.apellido}</Typography>
                </CardContent>
            </Card>
        </div>
    ))
    }
 */
const Conexion =(nombre, apellido,id)=>{
    return(
        <div id={id}>
            <Typography variant="h3">Datos de la base de datos</Typography>
             <Card>
                 <CardContent>
                    <Typography variant="h6" gutterBottom>Nombre: {nombre}</Typography>
                    <Typography variant="h6" gutterBottom>Apelllido: {apellido}</Typography>
                 </CardContent>
             </Card>
        </div>
    );
}
export default Conexion;
